#include <cmath>

int repeatedNumber(const std::vector<int> &A) {
    int n = A.size();
    int div_parameter = int(floor(std::sqrt(n)));
    std::vector<int> B(int(ceil(std::sqrt(n))), 0);
    for (const auto& el : A) {
        B[floor(el / div_parameter)]++;
    }
    int suspicious_set_index = 0;
    for (int i = 0; i < B.size(); ++i) {
        if (i != B.size() - 1) {
            if (B[i] > div_parameter) {
                suspicious_set_index = i;
                break;
            }
        } else {
            if (B[i] > (n - div_parameter * div_parameter)) {
                suspicious_set_index = i;
                break;
            }
        }
    }
    std::fill(B.begin(), B.end(), 0);
    for (const auto& el : A) {
        if ((el >= div_parameter * suspicious_set_index) and (el < div_parameter * (suspicious_set_index + 1))) {
            B[el - div_parameter * suspicious_set_index]++;
        }
    }
    for (int i = 0; i < B.size(); ++i) {
        if (B[i] > 1) {
            return i + div_parameter * suspicious_set_index;
        }
    }
    return -1;
}

